import React from "react";
import Question from "./Question";

const QuestionTable = (props) => {
  const questions = props.questions;
  console.log(questions);
  return (
    <table>
      <tbody>
        <tr>
          <td>Question ID</td>
          <td>Title</td>
          <td>Description</td>
          <td>Category</td>
          <td>Complexity</td>
        </tr>

        {questions.map((qn) => (
          <Question key={qn.id} question_data={qn} />
        ))}
      </tbody>
    </table>
  );
};

export default QuestionTable;
